import React from "react";
import Button from "@material-ui/core/Button";

export default function InitialPage() {
  return (
    <div className="inital">
      <h1>Assessment</h1>
      <Button type="submit" variant="contained" color="primary">
        Frontend
      </Button>

      <Button type="submit" variant="contained" color="primary">
        Backend
      </Button>
    </div>
  );
}
